package org.example.case29;import org.example.util.ListNode;import org.junit.jupiter.api.Test;import static org.junit.jupiter.api.Assertions.assertFalse;import static org.junit.jupiter.api.Assertions.assertTrue;public class Problem29Test {    @Test    void testPositive1() {        ListNode node = new ListNode(3, new ListNode(2, new ListNode(0, new ListNode(-4))));        ListNode node2 = node;        while(node2.next != null) {            node2 = node2.next;        }        node2.next = node.next;        assertTrue(new Problem29().hasCycle(node));    }    @Test    void testPositive2() {        ListNode node = new ListNode(1, new ListNode(2));        node.next = node;        assertTrue(new Problem29().hasCycle(node));    }    @Test    void testNegative1() {        ListNode node = new ListNode(1);        assertFalse(new Problem29().hasCycle(node));    }}